contracts/structuredecontrole.sol.content:
pragma solidity 0.8.7;

contract structuredecontrole { 

   uint nombre; 

   function setNombre() public { 
       require(nombre != 10, 'Le nombre ne peut pas etre egal a 10');
   }

   function getNombre() public view returns(uint) { 
       return nombre;
   }
}

